class AlbumCredit {
    constructor(
        id, 
        creditName, 
        creditContribution, 
        creditImageUrl, 
        creditAlbumId) {
            this.id = id
            this.creditName = creditName
            this.creditContribution = creditContribution
            this.creditImageUrl = creditImageUrl
            this.creditAlbumId = creditAlbumId
    }
}

export default AlbumCredit;